import {useState,useEffect} from "react";


function EffectTester(){

    const [count,setCount] = useState(0)

    useEffect(() => {
        alert(`hello ${count}`)
    }, []);
    function plusOneCount(){
        setCount(count+1)
    }


    return <div>
        <p onChange={()=>{
            alert(`Hi {count}`)
        }}> Count = {count}</p>
        <button onClick={plusOneCount}>plus one</button>

    </div>
}

export default EffectTester;
